import cv2
from random import shuffle
from cvtools import cv_load_image
import numpy as np
import matplotlib.pyplot as plt
from matplotlib.ticker import FuncFormatter


def show_data(file_name, error_list):
    with open(file_name) as f:
        lines = f.readlines()
    shuffle(lines)
    for line in lines:
        line = line.strip().split('\t')

        if int(line[0]) not in error_list:
            if int(line[0]) > (5466 + 4698):
                print(line[0])

                poly = list(map(int, line[2].split(',')))
                bbox = [min(poly[::2]), min(poly[1::2]), max(poly[::2]), max(poly[1::2])]

                image = cv_load_image(line[1])
                image = cv2.putText(image, line[-1], (bbox[0], bbox[1] + 20), cv2.FONT_HERSHEY_SIMPLEX, 1, (0, 0, 255),
                                    2)
                image = cv2.rectangle(image, (bbox[0], bbox[1]), (bbox[2], bbox[3]), (0, 0, 255), 2)
                cv2.imshow('image', image)
                cv2.waitKey()
                key = cv2.waitKey()
                if key & 0xFF == ord('q'):
                    break


def stats_zone(file_name, error_list):
    with open(file_name) as f:
        lines = f.readlines()
    r1, r2 = [], []
    for line in lines:
        line = line.strip().split('\t')
        poly = list(map(int, line[2].split(',')))
        bbox = [min(poly[::2]), min(poly[1::2]), max(poly[::2]), max(poly[1::2])]
        if (bbox[2] - bbox[0]) >= 600 or (bbox[3] - bbox[1]) >= 600:
            continue
        if int(line[0]) in error_list and int(line[0]) <= (5466 + 4698):
            w = bbox[2] - bbox[0]
            h = bbox[3] - bbox[1]
            ratio = max(w, h) / min(w, h)
            r1.append(ratio)
        if int(line[0]) not in error_list and int(line[0]) <= (5466 + 4698):
            w = bbox[2] - bbox[0]
            h = bbox[3] - bbox[1]
            ratio = max(w, h) / min(w, h)
            r2.append(ratio)
    print(len(r1), len(r2))

    def to_percent(y, position):
        return '%.2f' % (y / 15.89) + '%'

    formatter = FuncFormatter(to_percent)

    def to_percent1(y, position):
        return '%.2f' % (y / 85.75) + '%'

    formatter1 = FuncFormatter(to_percent1)

    fig, axs = plt.subplots(2, 1, sharex=True)

    # We can set the number of bins with the `bins` kwarg
    axs[0].yaxis.set_major_formatter(formatter)
    axs[1].yaxis.set_major_formatter(formatter1)
    bins = np.arange(1, 11, 0.5)
    axs[0].hist(r1, bins)
    axs[1].hist(r2, bins)
    plt.show()
    # plt.hist(r1, bins=50)


def stats_error(error_list):
    gt_flag = pos_flag = 0
    for index, line_id in enumerate(error_list):
        if line_id > 5466 and not gt_flag:
            gt_flag = index
        if line_id > (5466 + 4698) and not pos_flag:
            pos_flag = index
    error_pos_gt = gt_flag
    error_pos_dt = pos_flag - gt_flag
    error_neg_dt = len(error_list) - pos_flag
    print('pos_gt: {} / 5466 = {:.2f}\n'
          'pos_dt: {} / 4698 = {:.2f}\n'
          'neg_dt: {} / 5045 = {:.2f}'.
          format(error_pos_gt, error_pos_gt / 5466,
                 error_pos_dt, error_pos_dt / 4698,
                 error_neg_dt, error_neg_dt / 5045))
